CREATE PROC MPI_FETCH_CURRENT_ROLE_STATUS (@USERID INT)
AS
/*
CREATED BY : PRIYANKA MAHRANA 
CREATED AT : 13-11-2024
*/
BEGIN
SELECT USERID,CURRENTROLEID 
,CASE WHEN CURRENTROLEID = 1008 THEN 1
WHEN CURRENTROLEID = 1009 THEN 1
ELSE 2 END AS OUTPUT
FROM PERSONALSETTINGS
WHERE USERID= @USERID


END

