CREATE   PROC MPI_FETCH_CURRENT_USERID_AGAINST_USERNAME (@USERNAME NVARCHAR(250))    
AS    
/*    
CREATED BY : PRIYANKA MAHRANA     
CREATED AT : 13-11-2024    
EXEC MPI_FETCH_CURRENT_USERID_AGAINST_USERNAME 'MR. AKASH GUPTA'  
*/    
BEGIN    
  
SELECT USERID, 

(SELECT ReportsTo FROM UserReportingHierarchy WHERE OWNERID=985 AND MemberID=USERID AND ReportsTo<>USERID) AS REPORTSTOID
FROM AZ_USER
WHERE USERNAME = @USERNAME   
  
END    

