CREATE      PROCEDURE MPI_GET_RCO_APPROVAL_NAME(@FAID INT,@APPROVALTYPEID INT)    
AS     
BEGIN    
/*=======================================================================    
    
 Created By: Ali asgar baji; Created On: 29-Oct-2024;      
 Description: Stored Procedure will Import  Users in CRMNEXT;      
 Exec MPI_GET_RCO_APPROVAL_NAME 102216,3;      
    
=======================================================================*/   

DECLARE @APPROVALTYPE TABLE (TypeValue NVARCHAR(50));

IF @APPROVALTYPEID = 1
    INSERT INTO @APPROVALTYPE VALUES ('RCO');
ELSE IF @APPROVALTYPEID = 2
    INSERT INTO @APPROVALTYPE VALUES ('RCM'), ('RLC'), ('RCC Head'), ('SRCO');
ELSE IF @APPROVALTYPEID = 3
    INSERT INTO @APPROVALTYPE VALUES ('CFS Head'), ('PCEO'), ('Board');


SELECT     
	UserName AS APPROVERNAME,  
	A.ASSIGNEDTO AS APPROVALUSERID,
	APP_ex1_18 AS APPROVALTYPE
FROM APPROVAL A    
	INNER JOIN APP_Ex1 A1  ON A.OWNERID=A1.OWNERID AND A.APPROVALID=A1.APP_EX1_ID    
	INNER JOIN Az_User U ON A.OWNERID=U.AppOwnerID AND A.ASSIGNEDTO=U.UserID    
WHERE A.OWNERID=985 AND A.RELATEDTOTYPEID=100286 AND A.RELATEDTOID=@FAID AND LAYOUTID=10204024  
AND APP_ex1_18 in (SELECT TypeValue FROM @APPROVALTYPE)

END 

GO



