CREATE   PROC [DBO].[MPI_GET_MTB_DOC_VERIFICATION] (@FA_ID INT)    
AS    
/*    
  Created By : PRIYANKA MAHARANA; Created On : 26-Nov-2024;    
  Details: GET MTB DOC VERIFICATION
  EXEC MPI_GET_MTB_DOC_VERIFICATION NULL;    
*/    
BEGIN   

SELECT 
CASE WHEN Ver_ex1_66 = 'No' OR Ver_ex1_66 = 'N' THEN 1
ELSE 2 END AS OUTPUT
FROM VERIFICATION V
INNER JOIN Ver_ex1 V1 ON V1.Ver_ex1_ID=V.CustomObjectId
WHERE V.OWNERID=985 AND V.LAYOUTID=10204056 
AND V.RELATEDTOID = @FA_ID


END

