CREATE     PROC [dbo].[MPI_GET_TU_SCORE_FA] (@FAID INT)  
AS            
/*            
CREATED BY: ALI ASGAR BAJI         
CREATED ON: 29-11-2024        
DESCRIPTION: GET THE TU SCORE AND CRR RATING BASED ON THE FAID FOR PRIMARY BORROWER   
EXEC MPI_GET_TU_SCORE_FA 00101095
*/            
BEGIN    
  
  
SELECT   
Apl_ex3_97 AS TU_SCORE,   
Apl_ex5_68 AS TU_GRADE,  
Apl_ex5_7 AS CRR_RATING,  
RelatedToID  
FROM APPLICATION AP  
INNER JOIN APL_ex1 AP1 ON AP.OWNERID=AP1.OWNERID AND AP.APPLICATIONID=AP1.APL_ex1_ID  
INNER JOIN APL_ex3 AP3 ON AP.OWNERID=AP3.OWNERID AND AP.APPLICATIONID=AP3.APL_ex3_ID  
INNER JOIN APL_ex4 AP4 ON AP.OWNERID=AP4.OWNERID AND AP.APPLICATIONID=AP4.APL_ex4_ID  
INNER JOIN APL_ex5 AP5 ON AP.OWNERID=AP5.OWNERID AND AP.APPLICATIONID=AP5.APL_ex5_ID  
WHERE AP.OWNERID=985 AND AP.RELATEDTOTYPEID=100286 AND AP.RELATEDTOID=@FAID  
AND APL_EX1_53='P'  
    
END;   

GO



