CREATE  OR ALTER PROCEDURE [dbo].[MPI_UPDATE_FINANCIALAPPLICATION_QUICKCHECK](@OWNERID INT)          
AS           
/* DESCRIPTION - UPDATE APPLICATION STATUS ON MAIN APPLICATION THAT APP CHECK COMPLETE           
   CREATED ON - 27TH NOV 2024 | CREATED BY - ALI ASGAR  
   MPI_UPDATE_FINANCIALAPPLICATION_QUICKCHECK 985          
*/          
BEGIN          
SELECT   
DISTINCT  
RelatedToID AS CUSTOMOBJECTID,  
1 AS Fia_ex6_20  
FROM Application AP  
INNER JOIN APL_ex2 AP2   
ON AP.OWNERID=AP2.OWNERID AND AP.APPLICATIONID=AP2.APL_ex2_ID  
WHERE AP.OWNERID=985 AND  
ISNULL(Apl_ex2_1,1)!=1 AND  
ISNULL(Apl_ex2_2,1)!=1 AND  
ISNULL(Apl_ex2_3,1)!=1 AND  
ISNULL(Apl_ex2_4,1)!=1 AND  
ISNULL(Apl_ex2_5,1)!=1 AND  
ISNULL(Apl_ex2_6,1)!=1 AND  
ISNULL(Apl_ex2_7,1)!=1   
    
END 

